    casadi_copy(d.gf, 12, d.gLag);
    casadi_mv(d.Jk, casadi_s18, d_nlp.lam+12, d.gLag, 1);
    casadi_axpy(12, 1.0, d_nlp.lam, d.gLag);
    /* Primal infeasability */
    pr_inf = casadi_max_viol(48, d_nlp.z, d_nlp.lbz, d_nlp.ubz);
    /* inf-norm of lagrange gradient */
    du_inf = casadi_norm_inf(12, d.gLag);
    /* inf-norm of step */
    dx_norminf = casadi_norm_inf(12, d.dx);
    /* Checking convergence criteria */
    if (iter_count >= 0 && pr_inf < 1e-06 && du_inf < 1e-06) break;
    if (iter_count >= 50) break;
    if (iter_count >= 1 && iter_count >= 0 && dx_norminf <= 1e-10) break;
    /* Update/reset exact Hessian */
    m_arg[0] = d_nlp.z;
    m_arg[1] = m_p;
    m_arg[2] = &one;
    m_arg[3] = d_nlp.lam+12;
    m_res[0] = d.Bk;
    if (casadi_f10(m_arg, m_res, m_iw, m_w, 0)) return 1;
    /* Formulate the QP */
    casadi_copy(d_nlp.lbz, 48, d.lbdz);
    casadi_axpy(48, -1.0, d_nlp.z, d.lbdz);
    casadi_copy(d_nlp.ubz, 48, d.ubdz);
    casadi_axpy(48, -1.0, d_nlp.z, d.ubdz);
