    m_arg[0] = 0;
    m_arg[1] = 0;
    m_arg[2] = 0;
    m_arg[3] = 0;
    m_arg[4] = 0;
    m_arg[5] = 0;
    m_arg[6] = 0;
    m_arg[7] = 0;
    m_arg[8] = 0;
    m_arg[9] = 0;
    m_arg[10] = 0;
    m_arg[11] = 0;
    m_arg[0] = d.Bk;
    m_arg[1] = d.gf;
    m_arg[7] = d.dx;
    m_arg[8] = d.dlam;
    m_arg[9] = d.dlam+12;
    m_arg[5] = d.lbdz;
    m_arg[6] = d.ubdz;
    m_arg[2] = d.Jk;
    m_arg[3] = d.lbdz+12;
    m_arg[4] = d.ubdz+12;
    m_res[0] = 0;
    m_res[1] = 0;
    m_res[2] = 0;
    m_res[3] = 0;
    m_res[0] = d.dx;
    m_res[3] = d.dlam;
    m_res[2] = d.dlam+12;
    casadi_f14(m_arg, m_res, m_iw, m_w, 0);
